public void closeSelectRecord(Common _selectedRecord)
{
    if(canSelect)
    {
        if(element.args().parm() == #InsuranceSubscriber)
        {
            element.args().caller().getSubscriber(_selectedRecord);
            super(_selectedRecord);
        }
        else if(element.args().parm() == #NextToKin)
        {
            element.args().caller().storeNextToKin(DirPartyRelationship);
            super(_selectedRecord);
        }
        else if(element.args().parm() == #Relationships)
        {
            super(DirPartyTable);
        }
        else
        {
            element.args().caller().getPatient(_selectedRecord);
            super(_selectedRecord);
        }
    }
}

public void init()
{
    noWomenPatient = element.args().parmEnum() == NoYes::Yes ? true:false;
    super();
    canSelect = false;

    if(element.args().parm() == #NextToKin)
    {
        DirPartyRelationship_RelationshipTypeId.visible(true);
    }
}

