public void run()
{
    boolean                         filterLookup;
    FormStringControl               callingControl;

    callingControl = SysTableLookup::getCallerStringControl(element.args());
    filterLookup = SysTableLookup::FilterLookupPreRun(callingControl,DirPartyTable_Name,DirPartyTable_DS);

    super();

    SysTableLookup::FilterLookupPostRun(filterLookup,callingControl.text(), DirPartyTable_Name, DirPartyTable_DS);
}

public void init()
{
    containerClass conClass_Obj= element.args().parmObject();
    HMClinicStaff       HMClinicStaffLocal;

    super();
    this.query().dataSourceTable(tableNum(HMPatient)).addRange(fieldNum(HMPatient,Status)).value(SysQuery::value(PatientStatus::Active));
    if(element.args().parm() == #FromRelationShip || element.args().parm() == #NotShowCurrent)
    {
        this.queryBuildDataSource().addRange(fieldNum(HMPatient,RecId)).value(SysQuery::valueNot(conPeek(conClass_Obj.value(),1)));
    }
    // medisys -demo
    else if (element.args().parm() == #Medisys)
    {
        HMClinicStaffLocal = element.args().record();

        if (HMClinicStaffLocal.EvaluatPilots)
        {
            this.queryBuildDataSource().addRange(fieldNum(HMPatient,Pilot)).value(SysQuery::value(NoYes::Yes));
        }
        if (HMClinicStaffLocal.RAMQ)
        {
            this.queryBuildDataSource().addRange(fieldNum(HMPatient,RAMQ)).value(SysQuery::value(NoYes::Yes));
        }
        if (noWomenPatient)
        {
          this.query().dataSourceTable(tableNum(HMPatient)).addRange(fieldNum(HMPatient,Gender)).value(SysQuery::valueNot(HcmPersonGender::Female));
        }

    }
    else if(element.args().parm() == #FileTracker)
    {
        this.query().dataSourceTable(tableNum(HMPatient)).addRange(fieldNum(HMPatient,PhysicalChartNumber)).value(SysQuery::valueNotEmptyString());
    }

}

public int active()
{
    int ret;

    ret = super();

    if(ret)
    {
        element.loadImage();
    }

    return ret;
}

public void init()
{
    super();

    if(element.args().parm() == #SelectClient)
    {
        this.queryBuildDataSource().clearLinks();
        this.queryBuildDataSource().clearDynalinks();
    }
}

public void init()
{
    super();

    if(element.args().parm() != #NextToKin)
    {
        this.queryBuildDataSource().enabled(false);
    }
    else
    {
        this.queryBuildDataSource().clearLinks();
        this.queryBuildDataSource().clearDynalinks();
        this.queryBuildDataSource().addDynalink(fieldNum(DirPartyRelationship, ParentParty), DirPartyTable, fieldNum(DirPartyTable, RecId));

        this.queryBuildDataSource().addRange(fieldNum(DirPartyRelationship,ChildParty)).value(SysQuery::value(element.args().record().RecId));

    }
}

void clicked()
{
    canSelect = true;
    element.closeSelectRecord(HMPatient);

    super();
}
